import styled from "styled-components";

const HomeTitle = styled.h1`
  font-size: 50px;
  color: ${({ theme }) => theme.colors.textColor};
`;

const Home = () => {
  return (
    <div>
      <div>
        <div>
          <div>
            <p>Hi There!</p>
          </div>
          <div>
            <p>I'm Nagasai Jithin</p>
          </div>
          <div>
            <p>Front End Web Developer</p>
          </div>
          <div>
            <p>Alway's Student</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
